charValues = {")":1, "]":2, "}":3, ">":4}


def numFind(n):
    toRemove = []
    for row in range(0, len(n)):
        runningList = []
        for col in range(0, len(n[row])):
            if n[row][col] in openChars:
                runningList.append(n[row][col])
            if n[row][col] in closeChars:
                popped = runningList.pop(-1)
                if popped != oppositeChars[n[row][col]]:
                    toRemove.append(row)    
    for r in sorted(list(set(toRemove)), reverse=True):
        n.pop(r)
    return compRows(n)

def compRows(n):
    scores = []
    for row in n:
        missingPieces = []
        runningList = []
        for col in row:
            if col in openChars:
                runningList.append(col)
            if col in closeChars:
                popped = runningList.pop(-1)
        for j in runningList[::-1]:
            missingPieces.append(oppositeChars[j])
        scores.append(totalComp(missingPieces))
    scores = sorted(scores)
    return scores[int(len(scores) - (len(scores) / 2))]

def totalComp(n):
    total = 0
    for t in n:
        total = total * 5
        total += charValues[t]
    return total


